import React from "react";
import styles from "./Table.module.css";

const RowTable = (props) => {
  let arrDate = new Date(props.arrival * 1000);
  let arrival = arrDate.getHours() + ":" + arrDate.getMinutes();

  let depDate = new Date(props.departure * 1000);
  let departure = depDate.getHours() + ":" + depDate.getMinutes();

  return (
    <div className={styles.row}>
      <div className={styles.column_text}>
        <span>{departure}h</span>
        <span>{props.from}</span>
      </div>
      <div className={styles.column_text}>
        <span>Duration</span>
        <span>{props.duration}h</span>
      </div>
      <div className={styles.column_text}>
        <span>{arrival}h</span>
        <span>{props.to}</span>
      </div>
      <div className={styles.column_text}>
        <span>Operator</span>
        <span>FlixBus</span>
      </div>
      <div className={styles.column_text}>
        <span>Price</span>
        <span>{props.price} â‚¬</span>
      </div>
      <div className="add_button">
        <button type="button">Add</button>
      </div>
    </div>
  );
};

export default RowTable;
